const { Op } = require("sequelize");
const db = require("../utils/db");
const Sequelize = require("sequelize")

const get = async (req, res) => {
    const {count, rows} = await db.permissions.findAndCountAll();
    res.set('Content-Range', count).send({
        total: rows.length,
        data: rows
    })
}

module.exports = {
    get
};
  